import React from 'react'
import styled from 'styled-components'
import HeaderBG from '../assets/HeaderBG.webp'
import HomepageBG from '../assets/HomepageBG.webp'

const BlendedBackground = styled.div`
    width: 100%;
    background-image: 
    url(${HeaderBG}),
    url(${HomepageBG});
    background-size: cover, 140%;
    background-position: center, top;
    background-blend-mode: multiply;
`

function Header() {
  return (
    <div>
        <BlendedBackground/>
    </div>
  )
}

export default Header
